import React from 'react';
import {
  Dialog,
  DialogTitle
} from '@material-ui/core';

export default function FormDialog(props){
  console.log(props);
  return(
    <Dialog open={props.formDialogState}>
      <DialogTitle>Hello world!</DialogTitle>
    </Dialog>
  )
}
